import React, { useState } from "react";
import BlogList from "../Components/BlogList";

const Home = () => {
  const [blogs, setBlogs] = useState([]);
  return (
    <div className="container">
      <h1>Home</h1>
      <BlogList title="All Blogs!" blogs={blogs} />
    </div>
  );
};

export default Home;
